import React, { Component } from "react";
import News_Block from "./News_Block.js";

class Group_News extends Component {
  render() {
    return (
        <div className="">

        <div className="container">      
          <div className="row">
          <News_Block/>
          <News_Block/>
          <News_Block/>
          <News_Block/>
          <News_Block/>
          <News_Block/>
        </div>
          </div>
        </div>
    );
  }
}

export default Group_News;
